insert  into `brand`(`pk_brand_id`,`brand_name`,`fk_vertical_id`,`fk_partner_id`,`fk_roll_id`,`brand_description`,`brand_logo`,`brand_url`,`status`,`created_by`,`created_on`,`modified_by`,`modified_on`) values (70,'Better Global ',5,32,1,'better provides its customers with the purest and most natural medical grade cannabis experience.\n\nWe are proud of our use of advanced organic cultivation methods that take the environment and the patient’s health into account and because we are pioneers in converting  cannabis into a medical product both in Israel and globally','1609557108110cropped-BetterTM_belowtext_green_blue.jpg','https://www.better-global.com/en/',1,0,'2021-01-02 03:11:49',0,'2021-01-02 03:11:49'),(71,'GreenWays ',11,32,1,'Greenerways Organic’s mission has always been to create effective, affordable, organic solutions for your everyday problems. As a family-run business it is paramount to us that shoppers no longer have to compromise their safety based on what they can/can’t afford. All human beings deserve the right to live healthy lifestyles.\n\nWe’re dedicated to making life easier and more safe for families (and their pets) by providing an organic assortment of outdoor, lifestyle and personal care products that are infused with the best natural ingredients. We take this commitment seriously and our many approval seals attest to the level of investment we make on your behalf.\n\n','1609576804884GW_logo_PNG_01_1200x1200.png','https://greenerways.com/pages/about-us',1,0,'2021-01-02 08:40:06',0,'2021-01-19 14:16:05'),(72,'Brand From Account Manager ',7,34,1,'This is description for Brand created from Account Manager.',NULL,'http://d1x0iq8ltb1k4e.cloudfront.net/#/brands/brand-create',1,0,'2021-01-13 13:35:27',0,'2021-02-11 10:26:43'),(73,'Kim Crawford',11,33,1,'The vineyards of Kim Crawford are located in outstanding, predominantly coastal sites. The grapes benefit from long days, clean sea breezes and crisp nights. In combination with New Zealand’s long and dry autumn season, our grapes ripen slowly, which allows them to build flavor intensity as well as develop a sophisticated acidity. In the end, it is this unique combination of factors–from regions and soils, to temperatures and growth rates–that give Kim Crawford a perfect balance of fruit and acidity. ','1611065995954Kim-Crawford-Logo-300x300.png','https://www.kimcrawfordwines.com/',1,0,'2021-01-18 12:08:12',0,'2021-02-11 10:18:45'),(74,'New Brand 1',6,37,1,'',NULL,'',1,0,'2021-01-18 12:46:53',0,'2021-02-11 10:29:05'),(75,'Robert Mondavi Winery',11,33,1,'Since 1966, Robert Mondavi Winery has celebrated the appreciation of fine wine, food, and art - and remains the preeminent destination in the Napa Valley. We invite you to learn more about Robert Mondavi’s life, vision & legacy.','1610993231916Robert Mondavi Logo 3.png','https://www.robertmondaviwinery.com/',1,0,'2021-01-18 18:07:13',0,'2021-02-11 10:20:31'),(76,'TATA Motors',11,38,1,'Tata Motors Group (Tata Motors) is a $35 billion organisation. It is a leading global automobile manufacturing company. Its diverse portfolio includes an extensive range of cars, sports utility vehicles, trucks, buses and defence vehicles. Tata Motors is one of India\'s largest OEMs offering an extensive range of integrated, smart and e-mobility solutions\nPart of the USD113 billion Tata group founded by Jamsetji Tata in 1868, Tata Motors is among the world’s leading manufacturers of automobiles. We believe in ‘Connecting aspirations’, by offering innovative mobility solutions that are in line with customers\' aspirations. We are India\'s largest automobile manufacturer, and we continue to take the lead in shaping the Indian commercial vehicle landscape, with the introduction of leading-edge powertrains and electric solutions packaged for power performances and user comfort at the lowest life-cycle costs. Our new passenger cars and utility vehicles are based on Impact Design and offer a su','1611832403685Tata Motors Logo.jpg','https://www.tatamotors.com/',1,0,'2021-01-28 11:13:23',0,'2021-02-16 09:35:00'),(77,'New Goals and Vertical',26,34,1,'',NULL,'',1,0,'2021-02-12 10:54:33',0,'2021-02-12 11:17:55'),(78,'GreenerWays ',11,34,1,'Greenerways Organic’s mission has always been to create effective, affordable, organic solutions for your everyday problems. As a family-run business it is paramount to us that shoppers no longer have to compromise their safety based on what they can/can’t afford. All human beings deserve the right to live healthy lifestyles.\n\nWe’re dedicated to making life easier and more safe for families (and their pets) by providing an organic assortment of outdoor, lifestyle and personal care products that are infused with the best natural ingredients. We take this commitment seriously and our many approval seals attest to the level of investment we make on your behalf.\n\nIt’s important to us that you can pronounce every ingredient listed on our packaging and that you know exactly what’s inside our formulations. As we continue to grow, it’s our promise that we’ll keep this mission as the foundation for all future launches so that you and your loved ones can live a Greenerways Lifestyle  ',NULL,'https://greenerways.com/',1,0,'2021-02-23 00:11:03',0,'2021-02-23 00:11:03'),(79,'Lindt',11,39,1,'Lindt chocolate','1617066970412logo-lindt-corporate-392x138.png','https://www.lindt.com.au/',1,0,'2021-03-24 04:10:41',0,'2021-03-30 01:16:11'),(80,'Penfolds',26,39,1,'','1617083817979Screen Shot 2021-03-30 at 1.56.39 pm.png','https://www.penfolds.com/',1,0,'2021-03-30 05:55:52',0,'2021-03-30 05:56:59'),(81,'Menu Fresh',11,39,1,'Fake Subscription Box company used for Demo.','1617248258933Screen Shot 2021-04-01 at 11.37.21 am.png','https://www.menu-fresh.com',1,0,'2021-04-01 03:35:38',0,'2021-04-01 03:38:01'),(82,'Dinner Twist ',27,35,1,'Dinner twist has a range of fresh food boxes to suit any household. Our food boxes change weekly & are created using fresh seasonal and local produce.','1618989764643download (1).png','https://www.dinnertwist.com.au/ ',1,0,'2021-04-21 07:22:45',0,'2021-04-22 09:51:45'),(83,'Tanishq',7,40,1,'',NULL,'http://beta-Tanishq.com',1,0,'2021-04-23 09:15:17',0,'2021-04-23 09:15:17'),(84,'Pixel',6,39,1,'Some desc',NULL,'https://www.pixelbrand.com',1,0,'2021-04-23 14:37:48',0,'2021-04-23 14:37:48');

