insert  into `partner`(`pk_partner_id`,`partner_name`,`web_url`,`description`,`logo`,`fk_type_id`,`status`,`created_by`,`created_on`,`modified_by`,`modified_on`) values (32,'Visy Industries ','www.visy.com.au','Visy offer unique, fully integrated, forward thinking closed loop packaging and recycling solutions that align with customer and industry needs. Visy\'s manufacturing and processing, technology, logistics and design are part of a streamlined system that ensures our packaging solutions are consistently among the best in the world.  ','1609555100829Visy-Logokaka.png',10,1,0,'2021-01-02 02:38:22',0,'2021-01-02 02:38:22'),(33,'Enoplastic ','https://enoplastic.com/en/style-products/capsule/','Established in 1957, Enoplastic is the world’s largest manufacturer of PVC and polylaminate capsules , screw caps, synthetic corks and seals for still and sparkling wines, spirits, olive oil and vinegars.\nImpressive decorating capabilities including rotogravure printing, hot foil stamping, inking and embossing is a “Must” in addition to the special capabilities and knowhow for perfectly forming the capsules.\nStandard or custom colors are available as per as several options and customizations.\nEnoplastic is a global company with the Headquarter in Italy and local manufacturing and commercial subsidiaries in Spain, France, USA, Australia and New Zealand.','1609555385653enologo\'.jpg',10,1,0,'2021-01-02 02:43:06',0,'2021-01-02 02:43:06'),(34,'Digicorp Partner ','https://www.digi-corp.com/','This is description for Digicorp Partner.',NULL,9,1,0,'2021-01-13 13:18:20',0,'2021-01-18 05:57:26'),(35,'Digi-Corp Partner 1','https://www.digi-corp.com/','This is description for Digi-Corp Partner 1.',NULL,10,1,0,'2021-01-13 13:44:27',0,'2021-01-13 13:44:27'),(36,'Digicorp Partner 2','https://www.digi-corp.com/','This is description for Digicorp Partner 2',NULL,9,1,0,'2021-01-13 15:57:52',0,'2021-01-13 15:59:33'),(37,'Digicorp 3 edited',NULL,'this is description for digicorp 3',NULL,10,1,0,'2021-01-18 12:06:10',0,'2021-04-22 07:02:57'),(38,'TATA Group','https://www.tata.com/','Founded by Jamsetji Tata in 1868, the Tata group is a global enterprise, headquartered in India, comprising 30 companies across ten verticals.\n\nThe group operates in more than 100 countries across six continents, with a mission \'To improve the quality of life of the communities we serve globally, through long-term stakeholder value creation based on Leadership with Trust’.\n\nTata Sons is the principal investment holding company and promoter of Tata companies. Sixty-six percent of the equity share capital of Tata Sons is held by philanthropic trusts, which support education, health, livelihood generation and art and culture.\n\nIn 2019-20, the revenue of Tata companies, taken together, was $106 billion (INR 7.5 trillion). These companies collectively employ over 750,000 people.\n\nEach Tata company or enterprise operates independently under the guidance and supervision of its own board of directors. There are 29 publicly-listed Tata enterprises with a combined market capitalisation of $123 b','1611832269847Tata Group Logo.jpg',9,1,0,'2021-01-28 11:11:10',0,'2021-01-28 11:11:10'),(39,'Visy ','www.visy.com.au','Visy Industries was established in Melbourne in 1948 and has since grown to become one of the world\'s largest privately owned paper, packaging and recycling companies','1614300894703Visy-Logo_RGB_Standard_HR1-e1539736602414 (1).jpg',10,1,0,'2021-01-29 01:53:12',0,'2021-04-22 06:11:14'),(40,'tanishq','www.tanishq.com','Tanishq is an Indian jewellery brand and a division of Titan Company. Founded in 1994, Tanishq is headquartered in Bangalore, Karnataka, India','1619167993168b7e14d7f8d0d0b1a07846c8ff3787046.png',9,1,0,'2021-04-23 08:53:13',0,'2021-04-23 08:53:13');

