insert  into `product`(`pk_product_id`,`product_name`,`default_PWA`,`product_description`,`product_image`,`fk_brand_id`,`status`,`created_by`,`created_on`,`modified_by`,`modified_on`) values (84,'SUPPORT P.K','https://www.better-global.com/en/product/p-k-2__trashed/','This strain has a strong long-lasting effect, is a mood enhancer and helps relieve  intense pain and relax the body. Reduces stress and increases appetite. Has a dominant sour/spicy flavor with a lemony scent.','1609576080285PK_FLOWER.jpg',70,1,0,'2021-01-02 08:28:01',0,'2021-01-02 08:28:20'),(85,'T20/C4 KING DAVID','https://www.better-global.com/en/product/k-d-2/','This strain has a strong long-term influence, assists in relieving intense pain, relaxes the body, increases appetite and is a mood enhancer. Has a sour/spicy flavor with a fruity scent.','1609576578330akvlkj.jpg',70,1,0,'2021-01-02 08:36:19',0,'2021-01-13 12:04:27'),(86,'Greenerways Antibacterial Hand Soap 16 fl oz, 4-pack','https://www.costco.com/greenerways-antibacterial-hand-soap-16-fl-oz%2C-4-pack.product.100671830.html','Greenerways Antibacterial Hand Soap is formulated without sulfates, parabens, and artificial colors to gently cleanses away dirt and bacteria leaving hands fresh and clean.\n','1609577321490Screen Shot 2021-01-02 at 4.45.59 pm.png',71,1,0,'2021-01-02 08:48:42',0,'2021-01-02 15:29:20'),(87,'Product 1','http://d1x0iq8ltb1k4e.cloudfront.net/#/brands/product-add','This is description for Product 1',NULL,72,1,0,'2021-01-13 13:54:14',0,'2021-01-18 06:02:30'),(88,'Product - 2','http://d1x0iq8ltb1k4e.cloudfront.net/#/brands/product-add','',NULL,72,1,0,'2021-01-18 07:43:52',0,'2021-01-18 19:45:02'),(89,'Product 3','http://d1x0iq8ltb1k4e.cloudfront.net/#/brands/product-add','',NULL,72,1,0,'2021-01-18 07:45:45',0,'2021-01-18 10:24:35'),(90,'Product 4','http://d1x0iq8ltb1k4e.cloudfront.net/#/brands/product-add','',NULL,72,1,0,'2021-01-18 12:47:31',0,'2021-01-18 12:47:31'),(91,'2014 RESERVE TO KALON VINEYARD CABERNET SAUVIGNON OAK