  CONSTRAINT `fk_campaign_pc` FOREIGN KEY (`fk_campaign_id`) REFERENCES `campaign` (`pk_campaign_id`)
) ENGINE=InnoDB AUTO_INCREMENT=172 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='Campaign and PWA mapping';

