/*Table structure for table `tags` */

DROP TABLE IF EXISTS `tags`;

CREATE TABLE `tags` (
  `pk_tag_id` bigint NOT NULL,
  `no_of_tags` bigint DEFAULT NULL,
  `tag_mode` bigint DEFAULT NULL,
  `status` tinyint DEFAULT NULL,
  `created_by` bigint DEFAULT NULL,
  `created_on` datetime DEFAULT NULL,
  `modified_by` bigint DEFAULT NULL,
  `modified_on` datetime DEFAULT NULL,
  PRIMARY KEY (`pk_tag_id`),
  KEY `fk_tag_lookup_idx` (`tag_mode`),
  CONSTRAINT `fk_tag_lookup` FOREIGN KEY (`tag_mode`) REFERENCES `lookup` (`pk_lookup_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

